import React from "react";
import {filterData} from "./data";
import Navbar from "./Components/Navbar";
import Flter from "./Components/Fliter";
import Cards from "./Components/Cards";

const App = () => {
  return( 
    <div>
      <Navbar/>

      <Filter
        filterData = {filterData}
      />

      <Cards/>
    </div>
  )
};

export default App;
